window.bookSummaryJSON = "<p>At the heart of humanity</p> <p>At the beginning of everything</p> <p>Hope can be born… or destroyed</p> <p>For months, Princess Lorraine Adamant has fled from star system to star system in a desperate attempt to evade the minions of her uncle, the man who murdered her entire family to seize power in the Star Kingdom of Adamant.</p> <p>Thanks to the crew of her ship and her loyal bodyguard, Vigo Jarret, Lorraine has finally reached her goal: the homeworld, Earth. There, she plans to lay her case before the United Worlds, the oldest and greatest of humanity’s nations.</p> <p>But to an ancient democracy, the trials of an obscure kingdom are hardly relevant. Lorraine must turn her mind from war to diplomacy, to convince the homeworld to honor its oaths and save her Kingdom.</p> <p>One way… or another.</p>"; 
